menu_effect = 1

sequence = []
playerturn = False
start = False
gameover = False
nextlevel = True
pressed = False
score = 0
mistakes = 0
choice = None

def colision_circypunto(circ_x, circ_y, radio, x, y):
    if math.sqrt((circ_x-x)**2 + (circ_y-y)**2) < radio:
        return True
    return False

def crear_texto(fuente,texto,colortext,colorrect,posx,posy):
    text = fuente.render(texto, True, colortext, colorrect)
    textRect = text.get_rect()
    textRect.center = (posx, posy)
    winsurface.blit(text, textRect)

class Button:
    def __init__(self, i):
        self.id = i
        self.radio = (swidth+sheight)/2 * 0.24
        self.on = True
        if self.id == 0:
            self.x = swidth/2 - self.radio * 1.02
            self.y = sheight/2 - self.radio * 1.02
            self.sound = sounds[0]
        if self.id == 1:
            self.x = swidth/2 + self.radio * 1.02
            self.y = sheight/2 - self.radio * 1.02
            self.sound = sounds[1]
        if self.id == 2:
            self.x = swidth/2 + self.radio * 1.02
            self.y = sheight/2 + self.radio * 1.02
            self.sound = sounds[2]
        if self.id == 3:
            self.x = swidth/2 - self.radio * 1.02
            self.y = sheight/2 + self.radio * 1.02
            self.sound = sounds[3]

for n in range(4):
    buttons.append(Button(n))

while True:

    clock = pygame.time.Clock()
    deltaT = clock.tick(200)
    winsurface.fill(colors[0])
    mx, my = pygame.mouse.get_pos()
    mleft, _, mright = pygame.mouse.get_pressed()

    if mistakes == 3:

        gameover = True
        playerturn = True
        crear_texto(fuente,'GAME',colors[1],colors[0],swidth/2,sheight/2*0.95)
        crear_texto(fuente,'OVER',colors[1],colors[0],swidth/2,sheight/2*1.05)
        pygame.draw.circle(winsurface,colors[0],(swidth/2,sheight/2*1.9),(swidth+sheight)/2 * 0.05)
        crear_texto(fuente,'Menu',colors[1],colors[0],swidth/2,sheight/2*1.9)

        if mleft and colision_circypunto(swidth/2,sheight/2*1.9,(swidth+sheight)/2 * 0.05,mx,my):
            sequence = []
            playerturn = False
            start = False
            gameover = False
            nextlevel = True
            pressed = False
            score = 0
            mistakes = 0
            choice = None

    if mright:
        sequence = []
        playerturn = False
        start = False
        gameover = False
        nextlevel = True
        pressed = False
        score = 0
        mistakes = 0
        choice = None

    if score > 0:
        crear_texto(fuente,'Score: %s' % (score),colors[1],colors[0],swidth/2, sheight/2*0.075 if gameover else sheight/2*1.025)

    if start:
        while nextlevel and not gameover:
            sequence.append(random.randint(0,len(buttons)-1))
            show_sequence = sequence[:]
            play_sequence = sequence[:]
            nextlevel = False

        for button in buttons:
            button.on = False
            if playerturn:
                if colision_circypunto(button.x,button.y,button.radio,mx,my):
                    if mleft:
                        button.on = True
                        choice = button.id
                        if not pressed:
                            pressed = True
                            button.sound.play()
                    else:
                        pressed = False

            pygame.draw.circle(winsurface, colors[2] if button.id == 0 and button.on else colors[6] if button.id == 0 else colors[3] if button.id == 1 and button.on else colors[7] if button.id == 1 else colors[4] if button.id == 2 and button.on else colors[8] if button.id == 2 else colors[5] if button.id == 3 and button.on else colors[9], (button.x, button.y), button.radio)

        if not playerturn and not gameover:

            if len(show_sequence) > 0:
                p = show_sequence.pop(0)
                pygame.display.update()
                time.sleep(max(0.4-score*0.01,0.05))

                for button in buttons:
                    if p == button.id:
                        button.on = True
                        button.sound.play()
                    pygame.draw.circle(winsurface, colors[2] if button.id == 0 and button.on else colors[6] if button.id == 0 else colors[3] if button.id == 1 and button.on else colors[7] if button.id == 1 else colors[4] if button.id == 2 and button.on else colors[8] if button.id == 2 else colors[5] if button.id == 3 and button.on else colors[9], (button.x, button.y), button.radio)

                pygame.display.update()
                time.sleep(max(0.6-score*0.01,0.2))
            else:
                playerturn = True
                #print(play_sequence)

        if choice != None and not mleft and not gameover:

            if len(play_sequence) > 0:
                p = play_sequence.pop(0)
                #print('chose %s' % (choice))

                if p != choice:
                    show_sequence = sequence[:]
                    play_sequence = sequence[:]
                    playerturn = False
                    mistakes += 1

                    for button in buttons:
                        button.on = True
                        pygame.draw.circle(winsurface, colors[2] if button.id == 0 and button.on else colors[6] if button.id == 0 else colors[3] if button.id == 1 and button.on else colors[7] if button.id == 1 else colors[4] if button.id == 2 and button.on else colors[8] if button.id == 2 else colors[5] if button.id == 3 and button.on else colors[9], (button.x, button.y), button.radio)
                    crear_texto(fuente,'Wrong!',colors[2],colors[0],swidth/2,sheight/2*0.925)
                    pygame.display.update()
                    time.sleep(1)
                    #print('FAIL------------------------------------------------------------------------------------------------------')

                if len(play_sequence) == 0:
                    playerturn = False
                    score += 1
                    nextlevel = True

                    for button in buttons:
                        button.on = False
                        pygame.draw.circle(winsurface, colors[2] if button.id == 0 and button.on else colors[6] if button.id == 0 else colors[3] if button.id == 1 and button.on else colors[7] if button.id == 1 else colors[4] if button.id == 2 and button.on else colors[8] if button.id == 2 else colors[5] if button.id == 3 and button.on else colors[9], (button.x, button.y), button.radio)
                    crear_texto(fuente,'Nice!',colors[3],colors[0],swidth/2,sheight/2*0.925)
                    pygame.display.update()
                    time.sleep(0.5)
                    #print('SUCCEED---------------------------------------------------------------------------------------------------')

                choice = None

    else:

        deltaT = clock.tick(20)
        pygame.draw.circle(winsurface,colors[1],(swidth/2,sheight/2),(swidth+sheight)/2 * 0.075)
        crear_texto(fuente,'Start',colors[0],colors[1],swidth/2,sheight/2)
        menu_effect = (menu_effect-1) % len(buttons)

        for button in buttons:
            button.on = False
            if menu_effect == button.id:
                button.on = True
            pygame.draw.circle(winsurface, colors[2] if button.id == 0 and button.on else colors[6] if button.id == 0 else colors[3] if button.id == 1 and button.on else colors[7] if button.id == 1 else colors[4] if button.id == 2 and button.on else colors[8] if button.id == 2 else colors[5] if button.id == 3 and button.on else colors[9], (button.x, button.y), button.radio)

        if mleft and colision_circypunto(swidth/2,sheight/2,(swidth+sheight)/2 * 0.075,mx,my):
            start = True

    pygame.display.update()

    for event in pygame.event.get():
        if event.type == QUIT:
            pygame.quit()
            sys.exit()